import React from "react";
import { motion } from "framer-motion";

export default function Header() {
  return (
    <motion.header
      initial={{ y: -80, opacity: 0 }}
      animate={{ y: 0, opacity: 1 }}
      transition={{ duration: 0.7, ease: "easeOut" }}
      className="fixed w-full top-0 left-0 z-50 bg-white/30 backdrop-blur-md shadow-lg"
    >
      <div className="max-w-7xl mx-auto flex justify-between items-center px-8 py-4">
        <div className="flex items-center gap-3">
          <img
            src="https://cdn-icons-png.flaticon.com/512/5968/5968672.png"
            alt="Logo"
            className="w-10 h-10"
          />
          <h1 className="text-2xl font-bold text-gray-900">NeoTech</h1>
        </div>

        <nav className="hidden md:flex space-x-10 text-gray-700 font-medium">
          {["Home", "Services", "About", "Contact"].map((item) => (
            <a
              key={item}
              href={`#${item.toLowerCase()}`}
              className="hover:text-blue-600 hover:scale-105 transition-all"
            >
              {item}
            </a>
          ))}
        </nav>

        <a
          href="#contact"
          className="px-5 py-2 bg-gradient-to-r from-blue-500 to-cyan-500 text-white rounded-full font-semibold shadow-lg hover:scale-105 transition-transform"
        >
          Contact Us
        </a>
      </div>
    </motion.header>
  );
}
